import React from 'react';

class Profile extends React.Component {
  render () {
    return (
      <div>
        <h2>This is:</h2>
        <h3>NAME</h3>
        <p>PICTURE</p>
        <p>EMAIL</p>
        <p>AGE</p>
      </div>
    );
  }
}

export default Profile;
